PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE campaigns (
                    id TEXT PRIMARY KEY,
                    name TEXT NOT NULL,
                    status TEXT NOT NULL,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    last_updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    is_active BOOLEAN DEFAULT 1
                );
CREATE TABLE campaign_schedules (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    campaign_id TEXT NOT NULL,
                    schedule_type TEXT,
                    schedule_data TEXT,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    FOREIGN KEY (campaign_id) REFERENCES campaigns (id)
                );
CREATE TABLE outreach_emails (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    campaign_id TEXT NOT NULL,
                    email_address TEXT NOT NULL,
                    email_type TEXT,
                    is_active BOOLEAN DEFAULT 1,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    FOREIGN KEY (campaign_id) REFERENCES campaigns (id)
                );
CREATE TABLE email_limits (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    campaign_id TEXT NOT NULL,
                    daily_limit INTEGER DEFAULT 0,
                    weekly_limit INTEGER DEFAULT 0,
                    monthly_limit INTEGER DEFAULT 0,
                    current_daily_sent INTEGER DEFAULT 0,
                    current_weekly_sent INTEGER DEFAULT 0,
                    current_monthly_sent INTEGER DEFAULT 0,
                    last_reset_date DATE,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    FOREIGN KEY (campaign_id) REFERENCES campaigns (id)
                );
CREATE TABLE sync_history (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    sync_type TEXT NOT NULL,
                    campaigns_processed INTEGER DEFAULT 0,
                    campaigns_added INTEGER DEFAULT 0,
                    campaigns_updated INTEGER DEFAULT 0,
                    duration_seconds REAL DEFAULT 0,
                    sync_timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    status TEXT DEFAULT 'completed',
                    error_message TEXT
                );
DELETE FROM sqlite_sequence;
COMMIT;
